  false,\n\t\"url\": null,\n\t\"notes\": \"Light Detection and Ranging (LiDAR) data
  is remotely sensed high-resolution elevation data collected by an airborne collection
  platform. This LiDAR dataset is a survey of Coastal California. The project area
  consists of approximately 2616 square miles. The project design of the LiDAR data
  acquisition was developed to support a nominal post spacing of 1 meter. Fugro EarthData,
  Inc. acquired 1546 flight lines in 108 lifts between October 2009 and August 2011.
  This collection was a joint effort by the NOAA Office for Coastal Management (OCM);
  the California State Coastal Conservancy (SCC) Ocean Protection Council (OPC); Scripps
  Institution of Oceanography; and the Joint Airborne Lidar Bathymetry Technical Center
  of Expertise (JALBTCX). The data coverage extends landward 500 m from the shoreline,
  along the entire California coastline. The data collection was performed with two
  Piper Navajo twin engine aircrafts, utilizing a Leica ALS60 MPiA sensor; collecting
  multiple return x, y, and z as well as intensity data. The data were classified
  as Unclassified (1), Ground (2), Low Point (Noise) (7), Water (9), Mudflats (10),
  and 12 (Overlap). Only the Unclassified (1), Ground (2), Water (9), and Overlap
  (12) points are available for download from the NOAA OCM Digital Coast.\",\n\t\"license_title\":
